const Styles = {
    mainContainer: {
        backgroundColor: 'red',
        flex: 1,
        flexDirection: 'column-reverse',
        justifyContent: 'center',
        alignItems: 'center',
    }
}

const getDinamicStyles = (inset) => ({
    mainContainer: {
        paddingTop: insets.top,
        paddingBottom: insets.bottom,
    }
})

const getCommonStyle = (insets) => ({
    mainContainer: {
        paddingTop: insets.top,
        paddingBottom: insets.bottom,
    }
})


export default getCommonStyle
